const retrievedContactsDB=JSON.parse(localStorage.getItem("contactsString"));let contactsHTML=document.getElementById("contact-info");for(let t in retrievedContactsDB){let e=retrievedContactsDB[t];for(var obj=0;obj<e.length;obj++){var currentObject=e[obj];contactsHTML.innerHTML+=` \n        <li>${currentObject.service}: <a href=${currentObject.URL}>${currentObject.userName}</a></li>\n        <hr>\n        `}}